    "2013-03-14T19:32:30.661869",nt"name": "sierra-meadows-project-ds4",nt"isopen":
    false,nt"url": null,nt"notes": "Recognizing Montane Meadows and Quaking
    Aspen communities are a rare and valuable resource to plant and animal species in
    the Sierra Nevada, this project represents the beginning of a monitoring strategy
    for the conservation management of these ecosystems. The projects goals and objectives
    are to develop an accurate inventory of these systems, including high-resolution
    mapping and classification of community types, and surveys of selected terrestrial
    and aquatic animal species which depend on them. Other inventory related products
    include 360uc9f8 photography, online survey reports and dynamic maps. In addition,
    refinements to electronic data collection tools and applications are provided to
    enhance future assessment programs.",nt"license_title": null,nt"extras":
